@Orik1990   Sorry, I should have said "There isn't any useful English on there" because I can't imagine anyone sitting through an entire episode struggling to hear the English soundtrack.

@Talonade   Russia don't get this before anybody else.
This episode is called "Black Hole". It is numbered 16 as that is what Fox has numbered it.
Other people on here have this same episode numbered as 15 'cos that is what has been decided by someone else.
They are all the same episode.
